/**
 * Created by Nikita Mittal
 * 28th Nov 2018
 */

import React, {PureComponent} from 'react';
import moment from 'moment'
import map from 'lodash/map'

//import css
import './History.css';

class History extends PureComponent{
    render(){

        return (
            <div className="history-container">

                <div className="history-date-data-container">
                <div className="history-btc-container">
                <div className="history-date-container">{moment().format('DD MMM YYYY')}</div>
                <div className="history-data-container">1 BTC = $2809.31</div>
                </div>
                <div className="history-eth-container">
                <div>1 ETH = $224.33px</div>
                </div>
                <div className="history-ltc-container">
                    <div>1 LTC = $42.68</div>
                </div>
                </div>
            </div>
        )
    }
}

export default History
